Is a mocking framework for Java. Auto-generation of mock objects that implement a given interface. Logging of what calls are made to the mock objects. // GradesService.java public class GradesService { private final Gradebook gradebook; public GradesService(Gradebook gradebook) { this.gradebook = gradebook; } Double averageGrades(Student student) { return average(gradebook.gradesFor(student)); }
} // GradesServiceTest.java import static org.mockito.Mockito.*;
import static org.junit.Assert.*;
import org.junit.*; public class GradesServiceTest { private Gradebook gradebook; private Student student; @BeforeAll // Setup public static void setUp() { this.gradebook = mock(Gradebook.class); this.student = new Student(); } @Test // Test case public void testAverageGrades() { when(gradebook.gradesFor(student)).thenReturn(grades(9.0, 8.0, 7.0)); GradesService gradesService = new GradesService(this.gradebook); Double average = gradesService.averageGrades(this.student); assertEquals(8.0, average); } @AfterAll // Cleanup public static void cleanUp() { this.gradebook = null; this.student = null; }
} mock() method takes a class or an interface as an argument and creates a mock object of given class or interface. when() method takes a method call on mock object as an argument and defines return value for that method call. thenReturn() method defines return value for the method call. If you specify more than one value, they will be returned in sequence until the last one is used.

